const Caro = () => {
    const settings = {
        dots: true,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 3
    };
    return (
        <div className='container'>
            {slideData.map(item => (
                <div className='card'> 
                    <div className='cardTitle'>
                        <h1>{item.fname}</h1>
                        <h2>{item.lname}</h2>
                    </div>
                    <div className='cardContent'>
                        <p>{item.age}</p>
                    </div>
                </div>
            ))}
